description:
Young Asses Of Tahitian Island (Split Scenes)

patricia kimberly, sara lemos, sabrina ferrari, daiana don, milena prado

On a voyage to the sensual heart of the island these travelers find one another as interesting to explore as the beautiful island itself. Bring your binoculars and come along, the views here are breathtaking.

